import React from 'react';
import './App.css';



function App() {
  return (
    <div className="page_container">
      <div className="header_container">
      <div className="logo_content">
              <h1>yWaldo</h1>
              <p>SIGN UP TODAY TO EARN THE HIGHEST COMMISSIONS</p>
              <div className="input_form"></div>
      </div>  
      </div>

    </div>
  );
}

export default App;
